import React, { Component } from 'react';
import '../user/parameters.css'
import avatar from '../../images/avatar.jpg'

export class Parameters extends Component {
    render(){
        return (
        <div>
            <div className="card">
                <div className="row">                   
                    <img alt="concours au cameroun online-school" src={avatar} className='avatar'>lol</img>                   
                </div>                     
            </div>
        </div>
        );
    }
}
